import arrLeft from '../assets/imgs/arrow-left.png';
import arrRight from '../assets/imgs/arrow-right.png';
import news from '../assets/news/0.png'

function News(){

  //połączenie z api
  
  return(<div className="News">

    <img className="background" src={news}/>
    <button className="arrow left"><img src={arrLeft}/></button>
    <button className="arrow right"><img src={arrRight}/></button>
  </div>)
}

export default News;
